Whatcha Watching? // Part Two
Five way collaboration

@skoeetglass
@alecblowsglass
@hensleyartglass
@firefoxglass
@burgerboyglass 

This piece came together while Austin was in town, a little bit of everything from 5 talented people. It was a lot of fun to mix everything together to create one amazing piece. Skoeet did an incredible job putting together this massive project. Milli and marbles provided by Firefox, Fume TV by Austin & Burgerboy, along with the potato features by Alec. 

Opal coins, crushed opal, dichro, milli encasements, coldworking, CFL, UV, function, it’s all there. Gill perc on the TV feeds into two inline diffusers into the body for a smooth function. 

Big thank you to everyone who helped work on this

